export const themes = {
	red: {
		// backgroundColor: 'black',
		textColor: 'red'
	},
	light: {
		backgroundColor: 'white',
		textColor: 'black'
	}
}

export function getTheme(name) {
	if (name === 'dark') return themes.dark
}
